import React from "react";
import { Link } from "react-router-dom";
import "../Styles/Footer.css";
import logo from "../Assets/lightblue.svg";

const Footer = () => {
  return (
    <footer>
      <div className="footer-top">
        <div className="logo-container">
          <Link to="/" className="logo">
            <img src={logo} alt="Logo" className="logo-img" />
          </Link>
          <h2>
            Elevating Digital Experiences Through Design, Development, and
            More...
          </h2>
        </div>
        <hr className="footer-line" />{" "}
        {/* Add a horizontal line as a divider */}
      </div>
      <div className="footer-bottom">
        <p>&copy; 2024 Lilly Allgood. All rights reserved.</p>
        <p>
          Website by Lilly Allgood: designed with Figma & built with MERN stack.
        </p>
      </div>
    </footer>
  );
};

export default Footer;
